function changeAdmin(address newAdmin) public {
    require(newAdmin == address(newAdmin), "Invalid address");
    require(msg.sender != admin(), "Caller is not admin");

    bytes4 selector = msg.data[0:4];
    (bool success, bytes memory returnData) = implementation().delegatecall(selector);
    require(success, "Delegatecall failed");

    emit AdminChanged(admin(), newAdmin);
    require(newAdmin != address(0), "ERC1967: new admin is the zero address");

    setAdmin(newAdmin);
}

function admin() internal view returns (address) {
    return address(uint160(uint256(storage[0])));
}

function implementation() internal view returns (address) {
    return address(uint160(uint256(storage[1])));
}

function setAdmin(address newAdmin) internal {
    storage[0] = uint256(uint160(newAdmin));
}
